import React from 'react';

const Card = ({name, email, id}) => {	
	return(
	 <div className= "tc dib bg-white-10 br3 pa3 ma3 grow bw2 shadow-5" style="box-shadow: 0 0 15px 5px rgba(255, 0, 255, 0.7), 0 0 30px 10px rgba(0, 255, 255, 0.7), 0 0 45px 12px rgba(0, 255, 0, 0.7)">
	   <img alt='robots' src={`https://robohash.org/${id}?200x200`} />
	   <div>
		<h2 className='white-50 code'> {name} </h2>
		<p className='white-60 code'>  {email} </p>
	   </div>
	</div>
		 

		);
}

export default Card;
